        author_id = response.url[41:]
        author_name = response.xpath('//div[contains(@class, "user-profile_info")]/h1/text()').extract_first()
        location = response.xpath('//div[contains(@class, "user-profile_info")]/h3/text()').extract_first()
        review_count = response.xpath('//li[contains(@class, "review-count")]/strong/text()').extract_first()
        friend_count = response.xpath('//li[contains(@class, "friend-count")]/strong/text()').extract_first()
        photo_count = response.xpath('//li[contains(@class, "photo-count")]/strong/text()').extract_first()

        try:
            review_count = int(review_count)
        except:
            review_count = np.nan
        try:
            friend_count = int(friend_count)
        except:
            friend_count = np.nan
        try:
            photo_count = int(photo_count)
        except:
            photo_count = np.nan

        yield {
            'authorID': author_id,
            'name': author_name,
            'location': location,
            'reviewCount': review_count,
            'friendCount': friend_count,
            'photoCount': photo_count,
        }

